import React, { Component } from "react";

class App extends Component {
  state = {
    todo: [
      { id: 1, nom: "Lior chima" },
      { id: 2, nom: "Lior chima" },
    ],
  };
  render() {
    const element = this.state.todo.map((one) => {
      return (
        <li
          className="list-group-item list-group-item-success d-flex justify-content-evenly"
          key={one.key}
        >
          {one.nom} <button className="btn btn-danger">X</button>
        </li>
      );
    });
    return (
      <div className="container ">
        <div className="block">
          <div className="text-center rec">
            <h1 className="mt-5 pt-3">My To Do List</h1>

            <form action="">
              <input type="text" name="" id="" className="w-50 mt-3" />
              <button type="submit" className="btn btn-primary">
                Add
              </button>
            </form>
          </div>

          <ul className="list-group">
            {/* <li className="list-group-item list-group-item-success">
              A simple success list group item
            </li> */}
            {element}
          </ul>
        </div>
      </div>
    );
  }
}

export default App;
